I am using adaptive cards in bot framework. I want to change the background color of the card. I have tried using the `bgcolor` property but it is not working. I am using the following code:

```
var card = CardFactory.adaptiveCard({
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "TextBlock",
            "text": "Hello World",
            "size": "Medium",
            "weight": "Bolder",
            "color": "White",
            "bgcolor": "Red"
        }
    ]
});
```

## Answer (1)

You can use the `style` property to change the background color of the card. Here is an example:

```
var card = CardFactory.adaptiveCard({
    "type": "AdaptiveCard",
    "style": "light",
    "body": [
        {
            "type": "TextBlock",
            "text": "Hello World",
            "size": "Medium",
            "weight": "Bolder",
            "color": "White"
        }
    ]
});
```

You can find more information about the `style` property in the Adaptive Card documentation.

