 I'm trying to create a context that will close the previous tooltip and open the new one.

I have tried to create a context and use it in the Tooltip component but it doesn't work. I'm not sure if I'm using the context correctly.

```
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [isOpen, setIsOpen] = useState(false);
  const [content, setContent] = useState('');

  const openTooltip = (text) => {
    setIsOpen(true);
    setContent(text);
  };

  const closeTooltip = () => {
    setIsOpen(false);
    setContent('');
  };

  return (
    <TooltipContext.Provider value={{ isOpen, content, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
```

```
import React from 'react';
import { useTooltip } from '../context/TooltipContext';

